import _ from 'lodash'
import s from 'moment'

const formatAmount = (number) => {
    const options2 = { style: 'currency', currency: 'USD' };
    const numberFormat2 = new Intl.NumberFormat('en-US', options2);
    return numberFormat2.format(number);
}

const printTicket = async (data) => {
    console.log(data)
    const print = await AsyncStorage.getItem('PRINT');
    let arrNombre = [];
    if (data.name.length > 31) {
        let nombre = data.name;
        let inifito = true;
        while (inifito) {
            if (nombre.length > 31) {
                arrNombre.push(nombre.substring(0, 30));
                nombre = nombre.substring(32, nombre.length - 1);
            } else {
                arrNombre.push(nombre.substring(0, nombre.length - 1));
                inifito = false;
            }
        }
    } else {
        arrNombre.push(data.name);
    }

    let arrVendedor = [];
    if (data.salesName.length > 31) {
        let vendedor = data.salesName;
        let inifito = true;
        while (inifito) {
            if (vendedor.length > 31) {
                arrVendedor.push(vendedor.substring(0, 30));
                vendedor = vendedor.substring(32, vendedor.length - 1);
            } else {
                arrVendedor.push(vendedor.substring(0, vendedor.length - 1));
                inifito = false;
            }
        }
    } else {
        arrVendedor.push(data.salesName);
    }

    let arrDireccion = [];
    if (data.address.length > 31) {
        let direccion = data.address;
        let inifito = true;
        while (inifito) {
            if (direccion.length > 31) {
                arrDireccion.push(direccion.substring(0, 30));
                direccion = direccion.substring(32, direccion.length - 1);
            } else {
                arrDireccion.push(direccion.substring(0, direccion.length - 1));
                inifito = false;
            }
        }
    } else {
        arrDireccion.push(data.address);
    }

    //BluetoothManager.connect((print != null ? print.toString() : "00:00:00:00:00"))
    await BluetoothSerial.connect((print != null ? print.toString() : "00:00:00:00:00"))
        .then(
            async (s) => {
                //32 CARACTERES POR LINEA
                //await BluetoothEscposPrinter.printText("\r\n\r\n\r\n", {});
                await BluetoothSerial.write("\r\n\r\n\r\n", print);
                //await BluetoothEscposPrinter.printPic(imgLogoBase64, { width: 300, left: 45 });
                await BluetoothSerial.write(imgLogoBase64, print);
                //await BluetoothEscposPrinter.printerAlign(BluetoothEscposPrinter.ALIGN.CENTER);
                await BluetoothSerial.write("\r\nJUAN RAFAEL BLANCO REA\r\n", print);

                await BluetoothEscposPrinter.printText("\r\nJUAN RAFAEL BLANCO REA\r\n", {});
                await BluetoothEscposPrinter.printText("RFC: BARJ900502AYA\r\n", {});
                await BluetoothEscposPrinter.printText("LUIS ENCINAS PONIENTE NO. 1\r\n", {});
                await BluetoothEscposPrinter.printText("COL. CENTRO, C.P. 83000\r\n", {});
                await BluetoothEscposPrinter.printText("HERMOSILLO, SONORA, MÃ‰XICO\r\n", {});
                await BluetoothEscposPrinter.printText("TEL. (662)4 29 97 20\r\n", {});
                await BluetoothEscposPrinter.printText("\r\n\r\n", {});
                await BluetoothEscposPrinter.printText("--------------VENTA-------------\r\n", {});
                await BluetoothEscposPrinter.printerAlign(BluetoothEscposPrinter.ALIGN.RIGHT);
                await BluetoothEscposPrinter.printText("\r\nPEDIDO #: " + data.id + "\r\n", {});
                await BluetoothEscposPrinter.printText("\r\n" + data.createDate + "\r\n\r\n", {});
                await BluetoothEscposPrinter.printerAlign(BluetoothEscposPrinter.ALIGN.LEFT);
                await BluetoothEscposPrinter.printText("CLIENTE:\r\n", {});
                _.forEach(arrNombre, async (item) => {
                    await BluetoothEscposPrinter.printText(item + "\r\n", {});
                })
                await BluetoothEscposPrinter.printText("DIRECCION ENTREGA:\r\n", {});
                _.forEach(arrDireccion, async (item) => {
                    await BluetoothEscposPrinter.printText(item + "\r\n", {});
                })
                await BluetoothEscposPrinter.printText("VENDEDOR:\r\n", {});
                _.forEach(arrVendedor, async (item) => {
                    await BluetoothEscposPrinter.printText(item + "\r\n", {});
                })
                await BluetoothEscposPrinter.printText("\r\n------------PRODUCTOS-----------\r\n", {});
                _.forEach(data.cart, async (item) => {
                    let value = "";
                    let length = item.Nombre.length + (formatAmount(item.Precio)).length;
                    let dif = 32 - length;
                    if (dif > 0) {
                        value = item.Nombre + Array(dif).fill(' ').join('') + formatAmount(item.Precio);
                    }
                    await BluetoothEscposPrinter.printText(value + "\r\n", {});
                    await BluetoothEscposPrinter.printText("BANDA:" + item.label + "\r\n", {});

                    let arrNota = [];
                    if (item.note.length > 31) {
                        var nota = item.note;
                        var inifito = true;
                        while (inifito) {
                            if (nota.length > 31) {
                                arrNota.push(nota.substring(0, 30));
                                nota = nota.substring(32, nota.length - 1);
                            } else {
                                arrNota.push(nota.substring(0, nota.length - 1));
                                inifito = false;
                            }
                        }
                    } else {
                        arrNota.push(item.note);
                    }
                    await BluetoothEscposPrinter.printText("NOTA:" + "\r\n", {});
                    _.forEach(arrNota, async (item) => {
                        await BluetoothEscposPrinter.printText(item + "\r\n", {});
                    })
                })
                await BluetoothEscposPrinter.printText("\r\n", {});
                await BluetoothEscposPrinter.printText("--------------------------------\r\n", {});
                await BluetoothEscposPrinter.printerAlign(BluetoothEscposPrinter.ALIGN.RIGHT);
                let subtotal = "";
                let dif = 21 - ("SUBTOTAL:" + (formatAmount(data.subtotal))).length;;
                if (dif > 0) {
                    subtotal = "SUBTOTAL:" + Array(dif).fill(' ').join('') + formatAmount(data.subtotal);
                }
                await BluetoothEscposPrinter.printText(subtotal + "\r\n", {});
                let extra = "";
                let dif1 = 21 - ("EXTRA:" + (formatAmount(data.extra))).length;
                if (dif1 > 0) {
                    extra = "EXTRA:" + Array(dif1).fill(' ').join('') + formatAmount(data.extra);
                }
                await BluetoothEscposPrinter.printText(extra + "\r\n", {});
                let discount = "";
                let dif2 = 21 - ("DESCUENTO:" + (formatAmount(data.discount))).length;
                if (dif2 > 0) {
                    discount = "DESCUENTO:" + Array(dif2).fill(' ').join('') + formatAmount(data.discount);
                }
                await BluetoothEscposPrinter.printText(discount + "\r\n", {});
                let total = "";
                let dif3 = 21 - ("TOTAL:" + (formatAmount(data.total))).length;
                if (dif3 > 0) {
                    total = "TOTAL:" + Array(dif3).fill(' ').join('') + formatAmount(data.total);
                }
                await BluetoothEscposPrinter.printText(total + "\r\n\r\n", {});
                await BluetoothEscposPrinter.printText("\r\n--------------------------------\r\n", {});
                await BluetoothEscposPrinter.printerAlign(BluetoothEscposPrinter.ALIGN.CENTER);
                await BluetoothEscposPrinter.printText("FORMA DE PAGO" + "\r\n", {});
                if (data.cash > 0) {
                    let cash = "";
                    let dif4 = 21 - ("EFECTIVO:" + (formatAmount(data.cash))).length;
                    if (dif4 > 0) {
                        cash = "EFECTIVO:" + Array(dif4).fill(' ').join('') + formatAmount(data.cash);
                    }
                    await BluetoothEscposPrinter.printText(cash + "\r\n", {});
                }
                if (data.card > 0) {
                    let card = "";
                    let dif5 = 21 - ("TERMINAL TD:" + (formatAmount(data.card))).length;
                    if (dif5 > 0) {
                        card = "TERMINA TD:" + Array(dif5).fill(' ').join('') + formatAmount(data.card);
                    }
                    await BluetoothEscposPrinter.printText(card + "\r\n", {});
                }
                if (data.creditCard > 0) {
                    let creditCard = "";
                    let dif8 = 21 - ("TERMINAL TC:" + (formatAmount(data.creditCard))).length;
                    if (dif8 > 0) {
                        creditCard = "TERMINAL TC:" + Array(dif8).fill(' ').join('') + formatAmount(data.creditCard);
                    }
                    await BluetoothEscposPrinter.printText(creditCard + "\r\n", {});
                }
                if (data.transfer > 0) {
                    let transfer = "";
                    let dif6 = 21 - ("TRANSFE.:" + (formatAmount(data.transfer))).length;
                    if (dif6 > 0) {
                        transfer = "TRANSFE.:" + Array(dif6).fill(' ').join('') + formatAmount(data.transfer);
                    }
                    await BluetoothEscposPrinter.printText(transfer + "\r\n", {});
                }
                if (data.deposit > 0) {
                    let deposit = "";
                    let dif7 = 21 - ("DEPOSITO:" + (formatAmount(data.deposit))).length;
                    if (dif7 > 0) {
                        deposit = "DEPOSITO:" + Array(dif7).fill(' ').join('') + formatAmount(data.deposit);
                    }
                    await BluetoothEscposPrinter.printText(deposit + "\r\n", {});
                }
                await BluetoothEscposPrinter.printText("\r\n\r\n", {});
                await BluetoothEscposPrinter.printText("GRACIAS POR SU COMPRA" + "\r\n", {});
                await BluetoothEscposPrinter.printText("\r\n\r\n", {});
            },
            (e) => {
                Alert.alert(
                    "REVISAR IMPRESORA", "Impresora apagada, sin papel o direccion MAC incorrecta",
                    [
                        { text: "OK", onPress: () => console.log("OK Pressed") }
                    ]
                );
            }
        );
}

